@import 'variables.scss';

body {
    font-family: 'Futura New', sans-serif;
    max-width: 1920px;
    margin: 0 auto;

}

section {
    margin: 0 auto;
}

.header {
    display: flex;
    justify-content: space-between;
    max-width: 1760px;
    margin: 65px 80px 0;

    > a {
        pointer-events: none;
        cursor: default;
        max-width: 100px;
        max-height: 100px;
    
        img {
            width: 100%;
            height: 100%;
        }
    }

    &-nav {
        display: flex;
        align-items: center;

        a {
            @extend %tplstyle-sect-about-comp;
            color: $brown-light;

            &:not(:last-child) {
                padding-right: 80px;
            }
        }
    }

    &-location {
        display: flex;
        align-items: center;

        img {
            width: 46px;
            height: 46px;
        }

        p {
            @extend %tplstyle-sect-about-comp;
            color: $orange;
        }
    }
}

.about-comp-section {
    display: flex;
    max-width: 1920px;
    
    .nav {
        width: 40px;
        margin-left: 110px;
        margin-top: 130px;

        &-number {

            a {
                @extend %tplstyle-sect-about-comp;
                font-size: 20px;
                color: $brown-light;
            }
        
            &:not(:last-child) {
                padding: 0 14px 70px;
            }

            &:last-child {
                padding: 0 14px 10px;
            }

            &-active {
                width: 40px;
                height: 40px;
                background-image: url("img/nav-ellipse.svg");
                margin-bottom: 60px;
                padding: 10px 14px;

                a {
                @extend %tplstyle-sect-about-comp;
                font-size: 20px;
                color: $black-text;
                }
            }
        }
    }

    .about-comp-info {
        display: flex;
        margin-left: calc(265px / 1840px * 100%);  

        .block-comp-info {
            position: relative;
            max-width: 645px;
            margin-top: 151px;

            .comp-name {
                font-family: "SchoolBook Cyrillic", sans-serif;
                @include adaptiv-font (80, 24);
                line-height: 138%;
            }

            > a {
                display: inline-block;
                margin-top: 50px;
                margin-bottom: 197px;
                background: $orange;
                box-shadow: 0px 4px 20px $orange;
                border-radius: 33.5px;
                min-height: 67px;
                @extend %tplstyle-sect-about-comp;
                font-size: 20px;
                color: #fff;
                padding: 24px 77px;
                max-width: 285px;
                text-align: center;
            }

            .phone-number-media {
                display: none;
                color: $brown;
                font-weight: 700;
                @include adaptiv-font (24, 16);
                line-height: 125%;
                margin-top: -20px;
                margin-bottom: 20px;
            }

            .comp-info-social {
                margin-bottom: 80px;

                a {
                    display: inline-block;
                    background-color: #FFF;
                    border: transparent;
                    border-radius: 50%;
                    width: 40px;
                    height: 40px; 

                    img {
                        width: 100%;
                        height: 100%;
                    }
                }
                
                a:not(:last-child) {
                    margin-right: 50px;
                }
            }

            > img {
                position: absolute;
                right: 0;
                bottom: 0;
                max-width: 100%;
                max-height: 100%;
                opacity: .5;
                z-index: -1;
                visibility: hidden;
                
            }
        }

        .block-comp-contact {
            flex: 0 1 auto;
            display: flex;
            align-items: flex-end;
            position: relative;
            margin-left: 26px;
            max-width: 833px;
            max-height: 786px;
            margin-top: 130px;
            // margin-top: calc(130px / 1426px * 100%);

                .block-comp-contact-image img {
